f it were a single data source.','1#3#2','3#2#1',4,5),(103,30,5,3,'2016-05-20 01:25:43',5,5,'Este teste foi executado por Gleibson Simões - DRE 114139600, turma do prof. Fabrício Firmino/Maria Luiza, no curso de 2016.1 de Sistemas de Informação (UFRJ).','3#1#2','3#1#2',4,5),(104,18,5,1,'2016-05-20 02:51:47',5,5,'','2#1#3','1#3#2',2,3),(105,22,5,2,'2016-05-22 22:12:41',5,5,'A plataforma foi muito interessante de ser explorada. OS alunos geralmente gostam muito do Google, como um site para pesquisa, mas o STDOaP se mostrou até um pouco mais interessante por conta da facilidade de uso e por separar o conteúdo por país, por exemplo.','1#2#3','1#2#3',3,2),(106,25,5,1,'2016-05-27 15:10:02',5,5,'','1#2#3','3#1#2',1,3),(107,30,5,3,'2016-05-31 11:46:45',4,4,'When I select the option to filter by country, I couldn\'t see any way to remove that filter or which filters are currently applied in case there are more than one.','3#2#1','1#3#2',4,5),(108,26,5,4,'2016-05-31 11:59:46',5,5,'I did not manage to find any relevant datasets on river data quality after about 20 minutes of searching (using google). There were some available but they were for European rivers. The STDOaP is very useful and simple to use. Data is very easily discovered, and results are more relevant due to the availability of filtering. ','2#1#3','1#3#2',3,5),(109,28,5,5,'2016-05-31 12:15:30',NULL,NULL,NULL,'3#2#1','3#2#1',5,5),(110,35,5,2,'2016-05-31 15:19:54',5,4,'','2#3#1','3#1#2',4,5),(111,28,5,5,'2016-05-31 15:20:29',NULL,NULL,NULL,'1#3#2','1#3#2',5,5),(112,28,5,5,'2016-05-31 21:52:42',NULL,NULL,NULL,'3#1#2','1#2#3',5,5),(113,29,5,3,'2016-06-01 08:50:51',3,3,'','2#1#3','2#1#3',4,5),(114,24,5,3,'2016-06-02 21:34:08',5,5,'','2#3#1','3#1#2',4,4),(115,28,2,3,'2016-06-02 23:49:51',NULL,NULL,NULL,'3#1#2','3#1#2',3,3),(116,31,5,3,'2016-06-03 11:59:42',NULL,NULL,NULL,'1#3#2','3#2#1',5,5),(117,23,5,3,'2016-06-03 12:00:32',3,3,'','3#1#2','3#1#2',5,5),(118,33,5,5,'2016-06-03 12:02:39',5,4,'','3#1#2','2#3#1',5,5),(119,33,3,3,'2016-06-03 12:05:44',NULL,NULL,NULL,'2#1#3','3#2#1',3,3),(120,27,5,4,'2016-06-03 12:36:58',5,5,'Tá ótimo! Só falta dar um trato no design do site. ;)','2#1#3','1#3#2',4,4),(121,50,5,3,'2016-06-03 13:21:59',NULL,NULL,NULL,'1#3#2','1#3#2',4,3),(122,32,5,2,'2016-06-03 13:23:48',NULL,NULL,NULL,'2#3#1','3#1#2',2,3),(123,35,5,2,'2016-06-03 13:29:53',NULL,NULL,NULL,'1#2#3','1#2#3',4,5),(124,34,5,4,'2016-06-03 13:40:31',3,4,'','1#2#3','3#1#2',4,3),(125,34,5,3,'2016-06-03 13:48:22',5,5,'','3#1#2','1#2#3',5,5),(126,33,5,5,'2016-06-03 13:54:04',NULL,NULL,NULL,'1#3#2','1#3#2',4,4),(127,22,5,5,'2016-06-03 13:58:12',NULL,NULL,NULL,'3#2#1','1#3#2',5,4),(128,22,5,3,'2016-06-03 14:49:39',NULL,NULL,NULL,'2#1#3','1#3#2',4,4),(129,33,5,3,'2016-06-03 16:34:14',NULL,NULL,NULL,'3#2#1','3#2#1',5,5),(130,41,5,4,'2016-06-03 20:40:46',NULL,NULL,NULL,'2#3#1','3#1#2',3,4),(131,42,5,4,'2016-06-03 20:45:15',NULL,NULL,NULL,'3#2#1','3#2#1',3,4),(132,35,5,4,'2016-06-03 20:49:26',4,4,'I\'ll send you an email.','3#1#2','1#2#3',4,5),(133,62,5,4,'2016-06-03 21:16:56',NULL,NULL,NULL,'3#1#2','3#1#2',4,4),(134,62,5,4,'2016-06-03 21:28:45',4,2,'I think some improvement in semantic interpreter is needed.','3#2#1','2#1#3',4,4),(135,34,5,3,'2016-06-03 23:54:05',4,4,'','1#2#3','1#2#3',4,5),(136,30,5,3,'2016-06-04 21:57:33',NULL,NULL,NULL,'2#3#1','1#2#3',2,2),(137,33,5,3,'2016-06-05 18:16:39',4,3,'A ferramenta foi muito efetiva para encontrar DADOS ABERTOS pela internet.\r\nSenti dificuldades para encontrar datasets quando a busca não é realizada com termos em inglês ou por entidades fora dos Estados Unidos.\r\nPor exemplo, ao buscar por qualidade de água de rios no Brasil, não encontrei datasets brasileiros.  Apenas informações em datasets da NASA.\r\nMas imagino que isto seja mais um problema da carência e falta de iniciativa quanto à disponibilização de dados por parte do governo brasileiro.\r\nBoa sorte!','1#2#3','2#3#1',5,5);
